import React from "react";
import { useSelector } from "react-redux";
import { Link } from "react-router-dom";
import { StyledPokeDex } from "../styles/StyledPokeDex";

const DexPage = () => {
  const dex = useSelector((state) => state.dex);

  return (
    <StyledPokeDex dex={dex}>
      <Link style={{ color: "#d8a31a" }} to={`/pokemons/${dex[0].id}`}>
        <div>
          <img src={dex[0].pokeImage} alt="" />
          <h4>{dex[0].pokeName.toUpperCase()}</h4>
        </div>
      </Link>
    </StyledPokeDex>
  );
};

export default DexPage;
